import React, { Component } from 'react';
import List from '@material-ui/core/List';
import Box from '@material-ui/core/Box';

export default class Day extends Component {

    listStyle = {
        backgroundColor: "grey",
        // height: "auto"
    }

    render() {
        return (

            <List style={this.listStyle}>
                <Box height="100vh">
                </Box>
            </List>

        );
    }
}
